```Solidity
pragma solidity ^0.4.24;

contract Contract {
    mapping (address => uint) private userBalance;
    mapping (address => bool) private isOwner;
    uint private numOwners;
    uint private dailyLimit;
    uint private spentToday;
    uint private lastDay;
    uint private required;

    function addOwner(address owner) public returns (bool) {
        require(owner != 0x0);
        isOwner[owner] = true;
        numOwners++;
        return true;
    }

    function removeOwner(address owner) public returns (bool) {
        require(owner != 0x0);
        isOwner[owner] = false;
        numOwners--;
        return true;
    }

    function changeRequirement(uint _required) public returns (bool) {
        require(_required <= numOwners);
        required = _required;
        return true;
    }

    function resetSpentToday() public returns (bool) {
        if (now > lastDay + 24 hours) {
            spentToday = 0;
            lastDay = now;
            return true;
        }
        return false;
    }

    function confirm(bytes32 _h) public returns (bool) {
        bytes32 operation = sha3(msg.data);
        if (operation == _h) return true;
        else return false;
    }

    function execute(address _to, uint _value, bytes _data) public returns (bool) {
        require(_to != 0x0);
        require(_value <= userBalance[msg.sender]);
        require(isOwner[msg.sender]);
        require(now <= lastDay + 24 hours);
        require(spentToday + _value <= dailyLimit);
        _to.call.value(_value)(_data);
        userBalance[msg.sender] -= _value;
        spentToday += _value;
        return true;
    }

    function setDailyLimit(uint _newLimit) public returns (bool) {
        dailyLimit = _newLimit;
        return true;
    }

    function kill(address _to) public {
        require(isOwner[msg.sender]);
        selfdestruct(_to);
    }
}
```

